def predict(triples: list[Triple]) -> str:
    sentence = ""
    for i, triple in enumerate(triples):
        predicate = triple.predicate
        subject = triple.subject
        object_ = triple.object

        if i == 0:
            sentence += f"{subject} "

        if predicate == "author":
            sentence += f"is written by {object_} "
        elif predicate == "isbnNumber":
            sentence += f"has ISBN number {object_} "
        elif predicate == "followedBy":
            sentence += f"is followed by {object_} "
        elif predicate == "language":
            sentence += f"is written in {object_} "
        elif predicate == "country":
            sentence += f"is located in {object_} "
        elif predicate == "capital":
            if i > 0 and triples[i-1].predicate == "country":
                sentence = sentence[:-5] + f", the capital of which is {object_} "
            else:
                sentence += f" and its capital is {object_} "
        elif predicate == "nationality":
            sentence += f" and is of {object_} nationality "
        elif predicate == "spokenIn":
            sentence += f" and is spoken in {object_} "
        else:
            if predicate == "precededBy":
                sentence += f"and is preceded by {object_} "
            elif predicate == "numberOfPages":
                sentence += f"which has {object_} pages "
            elif predicate == "mediaType":
                sentence += f"and is a {object_} "
            elif predicate == "impactFactor":
                sentence += f"with an impact factor of {object_} "
            else:
                sentence += f"and its {predicate} is {object_}."

        if i < len(triples) - 1:
            sentence += " and "

    return sentence.strip() + "."

